'''Brimstail's cave''' is a small cave found in the southwestern section of the [[Tree Gnome Stronghold]]. It is the home of [[Brimstail]], a [[gnome]] wizard. It is the starting point of, and plays a large role in, [[The Eyes of Glouphrie]] [[quest]]. From here, by talking to Brimstail, players can travel to the [[rune essence]] mine. However this is not commonly used due to its distance from a [[bank]].

The cave is accessed via the [[Cave entrance (Brimstail's cave)|Cave entrance]], a unique hillside door not found anywhere else in Gielinor.
